import React, {useState} from 'react';
import axios from "axios";
import {Button} from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import { useCookies } from 'react-cookie';

const useToken = () => {
    const [cookies] = useCookies(['token']);
    return cookies.token;
};
const NewArticleForm = () => {
    const navigate = useNavigate();
    const [formData, setFormData] = useState({
        title: "",
        header: "",
        imageUrl: "",
        body: "",
        imageUrl1: "",
        imageUrl2: "",
        imageUrl3: "",
    });
    const token = useToken();
    const handleSubmit = (event) => {
        event.preventDefault();
        axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;
        axios.post("http://localhost:5098/CreateArticle", formData)
            .then((response) => {
                console.log(response.data);
                navigate("/");
            })
            .catch((error) => {
                console.error("Error:", error);
                navigate("/");
            });
    };

    const handleChange = (event) => {
        const {name, value} = event.target;
        setFormData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };

    return (
        <div className={"container"}>
            <div className={"row"}>
                <form onSubmit={handleSubmit}>
                    <div className={"offset-xl-2 col-xl-8"}>
                        <div className={"row mt-xl-4"} style={{backgroundColor: "white", borderRadius: "3px"}}>
                            <div className={"offset-xl-1 col-xl-10 mt-4"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Title</p>
                                <input className={"form-control"} type="text" id="title"
                                       name="title" value={formData.title} onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Header</p>
                                <input className={"form-control"} type="text" id="header"
                                       name="header" value={formData.header}
                                       onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Title image url</p>
                                <input className={"form-control"} type="text" id="imageUrl"
                                       name="imageUrl" value={formData.imageUrl}
                                       onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Body</p>
                                <textarea className={"form-control"} id="body" name="body"
                                          value={formData.body} onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Body image</p>
                                <input className={"form-control"} type="text" id="imageUrl1"
                                       name="imageUrl1" value={formData.imageUrl1}
                                       onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Body image</p>
                                <input placeholder="ImageUrl2" className={"form-control"} type="text" id="imageUrl2"
                                       name="imageUrl2" value={formData.imageUrl2}
                                       onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2"}>
                                <p className={"mb-0"} style={{fontWeight: 'bold'}}>Body image</p>
                                <input placeholder="ImageUrl3" className={"form-control"} type="text" id="imageUrl3"
                                       name="imageUrl3" value={formData.imageUrl3}
                                       onChange={handleChange}/>
                            </div>
                            <div className={"offset-xl-1 col-xl-10 mt-2 mb-4"}>
                                <button className={"w-100 btnLogin"} type="submit"><p
                                    className={"mt-xl-1 mb-xl-1"}>Submit</p></button>
                            </div>
                        </div>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default NewArticleForm;
